import React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import { StyleSheet, View } from 'react-native';

import Settingspage from "./Settings";
import EditPage from "../EdiitPage/EditPage";
import SavedmessagePage from "../../SavedMessagePage/SavedMessagePage";

const Stack = createStackNavigator();

const Navigation = () => {
  return (
    <View style ={styles.conteinernavigation}>
        <NavigationContainer >
        <Stack.Navigator 
        initialRouteName="Setting"
        screenOptions={{
            headerShown: false, // Приховати заголовок
        }}>
            <Stack.Screen name="Setting" component={Settingspage} />
            <Stack.Screen name="Edit Page" component={EditPage} />
            <Stack.Screen name="Savedmessage Page" component={SavedmessagePage} />
        </Stack.Navigator>
        </NavigationContainer>
    </View>
  );
};

const styles = StyleSheet.create({
    conteinernavigation:{
        backgroundColor:'#E3C07C'
    }
});

export default Navigation;
